definition:
To insert, as one piece of timber into another, by
   alternate scores or projections from the middle, to prevent slipping;
   to scarf.

To put under taboo; to forbid, or to forbid the use of;
   to interdict approach to, or use of; as, to taboo the ground set apart
   as a sanctuary for criminals.

Done or made in silence; implied, but not expressed; silent;
   as, tacit consent is consent by silence, or by not interposing an
   objection.

The part of a sail to which the tack is usually fastened;
   the foremost lower corner of fore-and-aft sails, as of schooners (see
   Illust. of Sail).

Any instruments of action; an apparatus by which an object
   is moved or operated; gear; as, fishing tackle, hunting tackle;
   formerly, specifically, weapons.

Of or pertaining to the organs, or the sense, of touch;
   perceiving, or perceptible, by the touch; capable of being touched; as,
   tactile corpuscles; tactile sensations.

Of or pertaining to Tagliacozzi, a Venetian surgeon;
   as, the Tagliacotian operation, a method of rhinoplasty described by
   him.

That which is told; an oral relation or recital; any
   rehearsal of what has occured; narrative; discourse; statement;
   history; story.

Of or pertaining to a talisman; having the properties
   of a talisman, or preservative against evils by occult influence;
   magical.

Reduced from a state of native wildness and shyness;
   accustomed to man; domesticated; domestic; as, a tame deer, a tame
   bird.

To unite or knit together confusedly; to interweave or
   interlock, as threads, so as to make it difficult to unravel the knot;
   to entangle; to ravel.

To direct, as an instructor; to manage, as a preceptor;
   to guide the studies of; to instruct; to inform; to conduct through a
   course of studies; as, to teach a child or a class.

A number of persons associated together in any work; a gang;
   especially, a number of persons selected to contend on one side in a
   match, or a series of matches, in a cricket, football, rowing, etc.

Something in the form of a transparent drop of fluid matter;
   also, a solid, transparent, tear-shaped drop, as of some balsams or
   resins.

To separate by violence; to pull apart by force; to rend;
   to lacerate; as, to tear cloth; to tear a garment; to tear the skin or
   flesh.

Of or pertaining to the telegraph; made or
   communicated by a telegraph; as, telegraphic signals; telegraphic art;
   telegraphic intelligence.

Of or pertaining to Temple, a valley in Thessaly,
   celebrated by Greek poets on account of its beautiful scenery;
   resembling Temple; hence, beautiful; delightful; charming.

To mingle in due proportion; to prepare by combining; to
   modify, as by adding some new element; to qualify, as by an ingredient;
   hence, to soften; to mollify; to assuage; to soothe; to calm.

The state of any compound substance which results from the
   mixture of various ingredients; due mixture of different qualities;
   just combination; as, the temper of mortar.

In a tender manner; with tenderness; mildly; gently;
   softly; in a manner not to injure or give pain; with pity or affection;
   kindly.

That course of thought which holds on through a discourse;
   the general drift or course of thought; purport; intent; meaning;
   understanding.

The act of stretching or straining; the state of being
   stretched or strained to stiffness; the state of being bent strained;
   as, the tension of the muscles, tension of the larynx.

The quality or state of being tenuous; thinness, applied
   to a broad substance; slenderness, applied to anything that is long;
   as, the tenuity of a leaf; the tenuity of a hair.

To be limited in space by a point, line, or surface;
   to stop short; to end; to cease; as, the torrid zone terminates at the
   tropics.

Consisting of land, in distinction from water;
   belonging to, or inhabiting, the land or ground, in distinction from
   trees, water, or the like; as, terrestrial serpents.

In modern usage, a book or roll in which the lands of
   private persons or corporations are described by their site,
   boundaries, number of acres, or the like.

Of or pertaining to all or any of the Territories of
   the United States, or to any district similarly organized elsewhere;
   as, Territorial governments.

One who governs by terrorism or intimidation;
   specifically, an agent or partisan of the revolutionary tribunal during
   the Reign of Terror in France.

Of or pertaining to the shell of a tortoise;
   resembling a tortoise shell; having the color or markings of a tortoise
   shell.

A scale series of four sounds, of which the extremes,
   or first and last, constituted a fourth. These extremes were immutable;
   the two middle sounds were changeable.

Having a valence of four; quadrivalent; tetravalent;
   sometimes, in a specific sense, having four hydroxyl groups, whether
   acid or basic.

A doctrine, or scheme of things, which terminates in
   speculation or contemplation, without a view to practice; hypothesis;
   speculation.

Slight; small; slender; flimsy; wanting substance or
   depth or force; superficial; inadequate; not sufficient for a covering;
   as, a thin disguise.

In a thin manner; in a loose, scattered manner; scantily;
   not thickly; as, ground thinly planted with trees; a country thinly
   inhabited.

Being on the farther side from the person speaking;
   farther; -- a correlative of hither; as, on the thither side of the
   water.

Passing through or to the end; hence, complete; perfect;
   as, a thorough reformation; thorough work; a thorough translator; a
   thorough poet.

To maintain obstinately against denial or contradiction;
   also, to contend or argue against (another) with obstinacy; to chide;
   as, he threaped me down that it was so.

The expression of an intention to inflict evil or injury on
   another; the declaration of an evil, loss, or pain to come; menace;
   threatening; denunciation.

Among or in the midst of; -- used to denote passage;
   as, a fish swims through the water; the light glimmers through a
   thicket.

Going or extending through; going, extending, or serving
   from the beginning to the end; thorough; complete; as, a through line;
   a through ticket; a through train. Also, admitting of passage through;
   as, a through bridge.

To push or drive with force; to drive, force, or impel;
   to shove; as, to thrust anything with the hand or foot, or with an
   instrument.

A local and habitual convulsive motion of certain muscles;
   especially, such a motion of some of the muscles of the face;
   twitching; velication; -- called also spasmodic tic.

Of or pertaining to tides; caused by tides; having tides;
   periodically rising and falling, or following and ebbing; as, tidal
   waters.

To form, as a knot, by interlacing or complicating a cord;
   also, to interlace, or form a knot in; as, to tie a cord to a tree; to
   knit; to knot.

The quality or tone distinguishing voices or instruments;
   tone color; clang tint; as, the timbre of the voice; the timbre of a
   violin. See Tone, and Partial tones, under Partial.

One who adapts his opinions and manners to the times;
   one who obsequiously compiles with the ruling power; -- now used only
   in a bad sense.

A distinct articulation given in playing quick notes on
   the flute, by striking the tongue against the roof of the mouth;
   double-tonguing.

Being under the influence of strong drink; rendered
   weak or foolish by liquor, but not absolutely or completely drunk;
   fuddled; intoxicated.

A fine transparent silk stuff, used for veils, etc.;
   specifically, cloth interwoven with gold or silver threads, or embossed
   with figures.

Bread dried and browned before a fire, usually in slices;
   also, a kind of food prepared by putting slices of toasted bread into
   milk, gravy, etc.

Hence, any person, especially a person of distinction, in
   honor of whom a health is drunk; hence, also, anything so commemorated;
   a sentiment, as "The land we live in," "The day we celebrate," etc.

To exert strength with pain and fatigue of body or mind,
   especially of the body, with efforts of some continuance or duration;
   to labor; to work.

The endurance of the presence or actions of
   objectionable persons, or of the expression of offensive opinions;
   toleration.

Destitute of the power of distinct articulation;
   having an impediment in the speech, esp. when caused by a short
   fraenum.

Situated above the topmast and below the royal mast;
   designatb, or pertaining to, the third spars in order from the deck;
   as, the topgallant mast, yards, braces, and the like. See Illustration
   of Ship.

Tossing the head, as in scorn or pride; hence, proud;
   contemptuous; scornful; affectedly indifferent; as, a tossy
   commonplace.

The act of touching the football down by a player behind
   his own goal line when it received its last impulse from an opponent;
   -- distinguished from safety touchdown.

Having the quality of flexibility without brittleness;
   yielding to force without breaking; capable of resisting great strain;
   as, the ligaments of animals are remarkably tough.

A mark left by anything passing; a track; a path; a
   course; a footprint; a vestige; as, the trace of a carriage or sled;
   the trace of a deer; a sinuous trace.

Capable of being easily led, taught, or managed;
   docile; manageable; governable; as, tractable children; a tractable
   learner.

Specifically: The act or business of exchanging commodities
   by barter, or by buying and selling for money; commerce; traffic;
   barter.

To teach and form by practice; to educate; to exercise;
   to discipline; as, to train the militia to the manual exercise; to
   train soldiers to the use of arms.

The act of translating, removing, or transferring;
   removal; also, the state of being translated or removed; as, the
   translation of Enoch; the translation of a bishop.

Like a traitor; involving treachery; violating
   allegiance or faith pledged; traitorous to the state or sovereign;
   perfidious in private life; betraying a trust; faithless.

To discourse; to handle a subject in writing or speaking;
   to make discussion; -- usually with of; as, Cicero treats of old age
   and of duties.

Having a three-lobed extremity or extremities, as a cross;
   also, more rarely, ornamented with trefoils projecting from the edges,
   as a bearing.

Fitted to excite fear or terror; such as may astonish
   or terrify by its magnitude, force, or violence; terrible; dreadful;
   as, a tremendous wind; a tremendous shower; a tremendous shock or fall.

To dig or cultivate very deeply, usually by digging
   parallel contiguous trenches in succession, filling each from the next;
   as, to trench a garden for certain crops.

Having a valence of three; trivalent; sometimes, in a
   specific sense, having three hydroxyl groups, whether acid or basic;
   thus, glycerin, glyceric acid, and tartronic acid are each triatomic.

The state of existing in tribes; also, tribal feeling;
   tribal prejudice or exclusiveness; tribal peculiarities or
   characteristics.

The lighter woodwork in the interior of a building;
   especially, that used around openings, generally in the form of a
   molded architrave, to protect the plastering at those points.

To move with light, quick steps; to walk or move lightly;
   to skip; to move the feet nimbly; -- sometimes followed by it. See It,
   5.

A nitrate formed from three molecules of nitric acid;
   also, less properly, applied to certain basic nitrates; as, trisnitrate
   of bismuth.

Of or pertaining to triumph; used in a triumph;
   indicating, or in honor of, a triumph or victory; as, a triumphal
   crown; a triumphal arch.

Of or connected with nutrition; nitritional; nourishing;
   as, the so-called trophic nerves, which have a direct influence on
   nutrition.

Commodities appropriate for barter, or for small trade;
   small commodities; esp., in the United States, garden vegetables raised
   for the market.

Something serving to deceive by false show or pretense;
   falsehood; deceit; worthless but showy matter; hence, things worn out
   and of no value; rubbish.

Assured resting of the mind on the integrity, veracity,
   justice, friendship, or other sound principle, of another person;
   confidence; reliance; reliance.

That which is true or certain concerning any matter or
   subject, or generally on all subjects; real state of things; fact;
   verity; reality.

To divide or separate, as one sort from another; to winnow;
   to sift; to pick out; -- frequently followed by out; as, to try out the
   wild corn from the good.

Having the form of a tube, or pipe; consisting of a pipe;
   fistular; as, a tubular snout; a tubular calyx. Also, containing, or
   provided with, tubes.

To inclose; to put within; to press into a close place;
   as, to tuck a child into a bed; to tuck a book under one's arm, or into
   a pocket.

Superintending care over a young person; the particular
   watch and care of a tutor or guardian over his pupil or ward;
   guardianship.

Especially, the act, art, or business of teaching;
   instruction; as, children are sent to school for tuition; his tuition
   was thorough.

Swelling in sound or sense; pompous; puffy; inflated;
   bombastic; falsely sublime; turgid; as, a tumid expression; a tumid
   style.

The commotion or agitation of a multitude, usually
   accompanied with great noise, uproar, and confusion of voices;
   hurly-burly; noisy confusion.

To put into a state adapted to produce the proper sounds;
   to harmonize, to cause to be in tune; to correct the tone of; as, to
   tune a piano or a violin.

Any similar garment worm by ancient or Oriental peoples;
   also, a common name for various styles of loose-fitting under-garments
   and over-garments worn in modern times by Europeans and others.

Having the lees or sediment disturbed; roiled; muddy;
   thick; not clear; -- used of liquids of any kind; as, turbid water;
   turbid wine.

To cause to present a different side uppermost or outmost;
   to make the upper side the lower, or the inside to be the outside of;
   to reverse the position of; as, to turn a box or a board; to turn a
   coat.

One of the successive portions of a course, or of a series of
   occurrences, reckoning from change to change; hence, a winding; a bend;
   a meander.

That which is prominently brought forward or exhibited;
   hence, an equipage; as, a man with a showy carriage and horses is said
   to have a fine turn-out.

To be contorted; to writhe; to be distorted by torsion;
   to be united by winding round each other; to be or become twisted; as,
   some strands will twist more easily than others.

Of or pertaining to a tyrant; suiting a tyrant;
   unjustly severe in government; absolute; imperious; despotic; cruel;
   arbitrary; as, a tyrannical prince; a tyrannical master; tyrannical
   government.
